  return (
    <form onSubmit={onSubmitHandler}>
      <textarea
        name="create_post_field"
        id="create_post_field"
        className="create_post_field"
        cols="50"
        rows="8"
        placeholder="Enter your post"
      ></textarea>
    </form>
  );
};

export default CreatePost;
